import requests
import time


def take_image(task, b1, b2, b3, b4, b5, b6):
    apikey = "YOUR_API_KEY"
    response = requests.post(
        "https://api.sctg.xyz/in.php",
        files=(
            # Для сеофаст здесь надо указать "seofast", для сеотайм "seotime"
            ('method', (None, "profit")),
            ('key', (None, apikey)),
            ('textinstructions', (None, task)),
            # Количество файлов body_ может быть любое, от 1 до 10, здесь для примера взята капча сеофаст на которой 6 изображений
            ('body_1', (None, b1)),
            ('body_2', (None, b2)),
            ('body_3', (None, b3)),
            ('body_4', (None, b4)),
            ('body_5', (None, b5)),
            ('body_6', (None, b6)),
        )
    )
    output = response.text
    if "|" not in output:
        return "FAIL"
    captcha_id = output.split("|")[1]

    index = 0
    output = "CAPCHA_NOT_READY"
    while output == "CAPCHA_NOT_READY":
        index += 1
        if index >= 20:
            return "FAIL"
        time.sleep(1)
        response = requests.get(f"https://api.sctg.xyz/res.php?key={apikey}&id={captcha_id}")
        output = response.text

    if "|" not in output:
        return "FAIL"
    image_id = output.split("|")[1]
    return image_id


if __name__ == '__main__':
    # Надо достать с кода страницы 6 картинок в base64, так же можно сделать скриншот этих фото
    image_1 = ""
    image_2 = ""
    image_3 = ""
    image_4 = ""
    image_5 = ""
    image_6 = ""

    # Задание надо отправлять полностью, можно на ru и en языке
    task = "Отметьте изображения с клавиатурами"

    namber_foto = take_image(task, image_1, image_2, image_3, image_4, image_5, image_6)
    if namber_foto == "FAIL":
        print("Капча не решена")
    else:
        if "," in namber_foto:
            # Если надо нажать на несколько фото, скрипт вернет номера нужных фото через ","
            # Например: 1,3,4
            print("Надо нажать на картинки номер " + namber_foto)
        else:
            # Если надо нажать на одно фото, то скрипт ее номер вернет без лишних знаков
            # Например: 2
            print("Надо нажать на картинку номер " + namber_foto)

